import React from "react";

import "./planetAnimation.scss";

const PlanetAnimation = () => {
  return (
    <svg>
      <circle
        cx="300"
        cy="300"
        r="245"
        fill="transparent"
        stroke="#e75626"
        strokeWidth="1px"
      />
    </svg>
  );
};

export default PlanetAnimation;
